import SignIn from "./SignIn";
import SignUp from "./SignUp";

class FormHandler extends Component {
  state = {};
  render() {
    return (
      <div>
 <b-tabs pills card>
        <b-tab title="Sign-up" active>
        <SignUp />

        </b-tab>
        <b-tab title="Login">
        </b-tab>
      </b-tabs>
        <br />
        <SignIn />
      </div>
    );
  }
}

export default FormHandler;
